import axios from "axios";
import { useState } from "react";

export default function Form3(props) {
    const [resp, setResponse] = useState([]);

    const sendSoapRequest = async (e) => {
        e.preventDefault();
        const url = 'http://127.0.0.1:8000/bank/management/'; 
        const soapEnvelope = `<x:Envelope xmlns:x="http://schemas.xmlsoap.org/soap/envelope/" xmlns:ban="bank.isg.tn">
            <x:Header/>
            <x:Body>
                <ban:get_all_accounts></ban:get_all_accounts>
            </x:Body>
        </x:Envelope>`;

        const config = {
            headers: {
                'Content-Type': 'text/xml;charset=UTF-8',
            },
        };

        try {
            const response = await axios.post(url, soapEnvelope, config);
            
            const parser = new DOMParser();
            const xmlDoc = parser.parseFromString(response.data, "text/xml");
            let accounts = [];
            let data = xmlDoc.getElementsByTagName("Account");
            for (let acc of data) {
                const rib = acc.getElementsByTagName("rib")[0]?.textContent;
                const cin = acc.getElementsByTagName("client")[0].getElementsByTagName("cin")[0]?.textContent;
                const name = acc.getElementsByTagName("client")[0].getElementsByTagName("name")[0]?.textContent;
                const family = acc.getElementsByTagName("client")[0].getElementsByTagName("family")[0]?.textContent;
                const mail = acc.getElementsByTagName("client")[0].getElementsByTagName("email")[0]?.textContent;
                const balance = acc.getElementsByTagName("balance")[0]?.textContent;
                const creation = acc.getElementsByTagName("creationDate")[0]?.textContent;
                accounts.push({ rib, cin, name, family, mail, balance, creation });
            }

            setResponse(accounts);

        } catch (error) {
            setResponse('Error occurred while fetching the accounts');
        }
    };

    return (
        <form onSubmit={sendSoapRequest} className='text-neutral-800 transition-all duration-300 font-regular text-[18px] px-8 w-full flex flex-col items-center gap-6'>
            <table className="border-separate border-spacing-2 border border-slate-500">
                <thead>
                    <tr>
                        <th>rib</th>
                        <th>cin</th>
                        <th>name</th>
                        <th>family</th>
                        <th>mail</th>
                        <th>balance</th>
                        <th>creation</th>
                    </tr>
                </thead>
                <tbody>
                    {resp.length === 0 ? (
                        <tr><td colSpan="7" className="text-center">No accounts found</td></tr>
                    ) : (
                        resp.map((acc, index) => (
                            <tr key={index}>
                                <td className="border border-slate-600">{acc.rib}</td>
                                <td className="border border-slate-600">{acc.cin}</td>
                                <td className="border border-slate-600">{acc.name}</td>
                                <td className="border border-slate-600">{acc.family}</td>
                                <td className="border border-slate-600">{acc.mail}</td>
                                <td className="border border-slate-600">{acc.balance}</td>
                                <td className="border border-slate-600">{acc.creation}</td>
                            </tr>
                        ))
                    )}
                </tbody>
            </table>
            <button type="submit" className='py-2 px-6 bg-neutral-800 hover:bg-neutral-900 transition-all duration-300 text-white rounded-md mt-4 w-full'>
                View All
            </button>
            <div className='text-[16px] text-neutral-600 flex justify-center ml-6 gap-5 w-full'>
                <button type="button" className='hover:text-neutral-800' onClick={() => props.setForm(1)}>
                    Add Account
                </button>
                -
                <button type="button" className='hover:text-neutral-800' onClick={() => props.setForm(2)}>
                    View Account
                </button>
            </div>
        </form>
    );
}
